import React from "react";

function AccountTypes({ heading, text, icon }) {
  return (
    <div className="container p-3" style={{ width: "30%" }}>
      <button className="p-3" id="account_btn" style={{ textAlign: "left", backgroundColor: "#fff", width: "100%"}}>
        <h4>
          {icon} {heading}
        </h4>
        <p className="fs-5">{text}</p>
      </button>
    </div>
  );
}

export default AccountTypes;
